function(stream) {
      stream.setEncoding('ascii');

      let buffer = '';
      stream.on('data', function(data) {
          buffer += data;
          const offset = buffer.lastIndexOf("\n");
          if (offset > -1) {
             const packet = buffer.slice(0, offset + 1);
             buffer = buffer.slice(offset + 1);
             callback(packet, new rinfo(stream, packet));
          }
      });
  }

